-- ----------------------------
-- Table structure for qrtz_triggers
-- ----------------------------
DROP TABLE IF EXISTS `qrtz_triggers`;
CREATE TABLE `qrtz_triggers` (
  `SCHED_NAME` varchar(120) NOT NULL COMMENT 'Scheduler',
  `TRIGGER_NAME` varchar(200) NOT NULL COMMENT 'Trigger key',
  `TRIGGER_GROUP` varchar(200) NOT NULL COMMENT 'Trigger group',
  `JOB_NAME` varchar(200) NOT NULL COMMENT 'Job key',
  `JOB_GROUP` varchar(200) NOT NULL COMMENT 'Job group ',
  `DESCRIPTION` varchar(250) DEFAULT NULL COMMENT 'Trigger  .withDescription()string',
  `NEXT_FIRE_TIME` bigint(13) DEFAULT NULL COMMENT '',
  `PREV_FIRE_TIME` bigint(13) DEFAULT NULL COMMENT '-1',
  `PRIORITY` int(11) DEFAULT NULL COMMENT 'Trigger 5',
  `TRIGGER_STATE` varchar(16) NOT NULL COMMENT 'TriggerPAUSED_BLOCKED:_; PAUSED:; WAITING:; ACQUIRED:; EXECUTING:; COMPLETE:; BLOCKED:; ERROR:; DELETED:',
  `TRIGGER_TYPE` varchar(8) NOT NULL COMMENT 'Cron  Simple',
  `START_TIME` bigint(13) NOT NULL COMMENT 'Trigger',
  `END_TIME` bigint(13) DEFAULT NULL COMMENT 'Trigger',
  `CALENDAR_NAME` varchar(200) DEFAULT NULL COMMENT 'TriggerCalendar name',
  `MISFIRE_INSTR` smallint(2) DEFAULT NULL COMMENT 'misfireid',
  `JOB_DATA` blob COMMENT 'TriggerJobDataMap',
  PRIMARY KEY (`SCHED_NAME`,`TRIGGER_NAME`,`TRIGGER_GROUP`),
  KEY `IDX_QRTZ_T_J` (`SCHED_NAME`,`JOB_NAME`,`JOB_GROUP`),
  KEY `IDX_QRTZ_T_JG` (`SCHED_NAME`,`JOB_GROUP`),
  KEY `IDX_QRTZ_T_C` (`SCHED_NAME`,`CALENDAR_NAME`),
  KEY `IDX_QRTZ_T_G` (`SCHED_NAME`,`TRIGGER_GROUP`),
  KEY `IDX_QRTZ_T_STATE` (`SCHED_NAME`,`TRIGGER_STATE`),
  KEY `IDX_QRTZ_T_N_STATE` (`SCHED_NAME`,`TRIGGER_NAME`,`TRIGGER_GROUP`,`TRIGGER_STATE`),
  KEY `IDX_QRTZ_T_N_G_STATE` (`SCHED_NAME`,`TRIGGER_GROUP`,`TRIGGER_STATE`),
  KEY `IDX_QRTZ_T_NEXT_FIRE_TIME` (`SCHED_NAME`,`NEXT_FIRE_TIME`),
  KEY `IDX_QRTZ_T_NFT_ST` (`SCHED_NAME`,`TRIGGER_STATE`,`NEXT_FIRE_TIME`),
  KEY `IDX_QRTZ_T_NFT_MISFIRE` (`SCHED_NAME`,`MISFIRE_INSTR`,`NEXT_FIRE_TIME`),
  KEY `IDX_QRTZ_T_NFT_ST_MISFIRE` (`SCHED_NAME`,`MISFIRE_INSTR`,`NEXT_FIRE_TIME`,`TRIGGER_STATE`),
  KEY `IDX_QRTZ_T_NFT_ST_MISFIRE_GRP` (`SCHED_NAME`,`MISFIRE_INSTR`,`NEXT_FIRE_TIME`,`TRIGGER_GROUP`,`TRIGGER_STATE`),
  CONSTRAINT `qrtz_triggers_ibfk_1` FOREIGN KEY (`SCHED_NAME`, `JOB_NAME`, `JOB_GROUP`) REFERENCES `qrtz_job_details` (`SCHED_NAME`, `JOB_NAME`, `JOB_GROUP`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Trigger';

